"     Patient information: Newborn hypoglycemia (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/newborn-hypoglycemia-the-basics?source=topic_page\">",
