"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H29665073\">",
"      <span class=\"h1\">",
"       What is newborn hypoglycemia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Newborn hypoglycemia is a condition that happens when a newborn baby does not have enough sugar in the blood. &ldquo;Hypoglycemia&rdquo; is the medical term for low blood sugar.",
"     </p>",
"     <p>",
"      It is normal for a baby&rsquo;s blood sugar to go down after birth. It usually comes back to normal when the baby is fed breast milk or formula. If blood sugar stays low after feeding, a baby might need treatment.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29665088\">",
"      <span class=\"h1\">",
"       What are the symptoms of newborn hypoglycemia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Many babies do not have any symptoms. Some babies have symptoms that include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Shaking or trembling",
"       </li>",
"       <li>",
"        Weak or flabby muscles",
"       </li>",
"       <li>",
"        Acting irritable or cranky",
"       </li>",
"       <li>",
"        Acting sleepy",
"       </li>",
"       <li>",
"        Breathing problems, such as fast breathing or stopping breathing at times",
"       </li>",
"       <li>",
"        Skin that looks blue, feels cold, or both &nbsp;",
"       </li>",
"       <li>",
"        Trouble sucking on a breast or bottle (Some babies eat less than normal.)",
"       </li>",
"       <li>",
"        Seizures",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29665103\">",
"      <span class=\"h1\">",
"       Is there a test for newborn hypoglycemia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. A blood test can measure how much sugar is in the blood. Doctors can order this test if a baby has symptoms of newborn hypoglycemia, or has a higher risk of the condition.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29665118\">",
"      <span class=\"h1\">",
"       How is newborn hypoglycemia treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;All newborn babies need breast milk or formula soon after birth. This can help keep hypoglycemia from happening.",
"     </p>",
"     <p>",
"      Some babies have a higher risk of newborn hypoglycemia than other babies do. For example, if a baby is premature or the mother has diabetes, the baby has a higher risk. These babies should be fed breast milk or formula within 1 hour of birth. A doctor or nurse will do blood tests to keep track of how much sugar is in the blood.",
"     </p>",
"     <p>",
"      If a baby still has low blood sugar after feeding, doctors might give a sugar mixture through a thin tube called an &ldquo;IV.&rdquo; The tube goes into a vein. This gets sugar into the baby&rsquo;s bloodstream right away.",
"     </p>",
"     <p>",
"      Most babies only need the sugar mixture for a short time. If a baby needs it after he or she is 3 or 4 days old, the doctor might order more tests. Depending on the results, he or she might give the baby medicine or do surgery.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29665132\">",
"      <span class=\"h1\">",
"       More on this topic",
