var title_f18_6_18535="Surgical drainage of dorsal subcutaneous abscess of the hand";
var content_f18_6_18535=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F53109&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F53109&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Surgical drainage of dorsal subcutaneous abscess of the hand",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 395px; height: 584px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The dorsal skin of the hand is loosely anchored to the underlying tissue, which allows the spread of infection into two potential spaces; the dorsal subcutaneous space, which is superficial to the extensor tendons, and the dorsal subaponeurotic space, which is deep to the extensor tendons.",
"    <br>",
"     Panels A through C demonstrate surgical drainage of a subcutaneous abscess of the dorsum of the right hand:",
"     <br>",
"      (A) Pre-operative appearance.",
"      <br>",
"       (B) Intra-operative appearance.",
"       <br>",
"        (C) Post-operative appearance.",
"        <br>",
"         Panel D shows a more extensive dorsal subaponeurotic abscess. Patients who require extensive debridement may need additional surgical procedures to resurface the resulting soft tissue defect.",
"         <div class=\"footnotes\">",
"         </div>",
"         <div class=\"reference\">",
"         </div>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
