var title_f18_6_18540="Causes central cyanosis newborn";
var content_f18_6_18540=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F50161&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F50161&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Causes of central cyanosis in the neonate",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Right-to-left shunt",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intracardiac level: cyanotic disease, anomalous systemic venous connection to left atrium",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Great vessel level: persistent pulmonary hypertension of the newborn",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intrapulmonary level: pulmonary arteriovenous malformation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Ventilation/perfusion mismatch",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Airway disease: pneumonia, aspiration, cystic adenomatoid malformation, diaphragmatic hernia, pulmonary hypoplasia, lobar emphysema, atelectasis, pulmonary hemorrhage, hyaline membrane disease, transient tachypnea of the newborn",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Extrinsic compression of lungs: pneumothorax, pleural effusion, chylothorax, hemothorax, thoracic dystrophy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Alveolar hypoventilation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Central nervous system depression: asphyxia, maternal sedation, intraventricular hemorrhage, seizure, meningitis, encephalitis, apnea of prematurity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neuromuscular disease: Werdnig-Hoffman disease, neonatal myasthenia gravis, phrenic nerve injury",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Airway obstruction: choanal atresia, laryngotracheomalacia, macroglossia, Pierre Robin syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Hemoglobinopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Methemoglobinemia: congenital or secondary to toxic exposure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Other hemoglobinopathies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Diffusion impairment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pulmonary edema: left-sided obstructive cardiac disease, cardiomyopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pulmonary fibrosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Congenital lymphangiectasia",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br>",
"      <br>",
"       <ol>",
"        <li>",
"         Lees MH. J Pediatr 1970; 77:484.",
"        </li>",
"        <li>",
"         Marino BS, Bird GL, Wernovsky G. Clin Perinatol 2001; 28:91.",
"        </li>",
"        <li>",
"         Baum VC, McDaniel NL. Cyanosis. In: Ambulatory Pediatric Care, 3rd ed, Dershewitz RA (Ed), Lippincott-Raven, Philadelphia 1999. p.921.",
"        </li>",
"       </ol>",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
