"    Staphylococcus aureus adenitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 291px; height: 278px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
